import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Button, TextField, FormControl, InputLabel, Select, MenuItem, Checkbox, FormGroup, FormControlLabel, Container, Typography } from '@mui/material';

function RecommendNominee() {
    const [nominees, setNominees] = useState([]);
    const [selectedNominee, setSelectedNominee] = useState('');
    const [workContributions, setWorkContributions] = useState({
        individual_contributor: false,
        project_manager: false,
        people_manager: false
    });
    const [answers, setAnswers] = useState({
        ic_q1: '',
        ic_q2: '',
        ic_q3: '',
        ic_q4: '',
        ic_q5: '',
        pm_question: '',
        pep_question: ''
    });
    const navigate = useNavigate();

    useEffect(() => {
        axios.get('http://127.0.0.1:5000/nominees')
            .then(response => {
                setNominees(response.data);
            })
            .catch(error => console.error('Error fetching nominees:', error));
    }, []);

    const handleWorkContributionChange = (event) => {
        setWorkContributions({ ...workContributions, [event.target.name]: event.target.checked });
    };

    const handleInputChange = (event) => {
        setAnswers({ ...answers, [event.target.name]: event.target.value });
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        const formData = {
            nominee_id: selectedNominee,
            work_contributions: Object.keys(workContributions).filter(key => workContributions[key]),
            ...answers
        };

        axios.post('http://127.0.0.1:5000/recommendation/create', formData)
            .then(() => navigate('/recommender/dashboard'))
            .catch(error => console.error('Error submitting recommendation:', error));
    };

    const handleBack = () => {
        navigate('/recommender/dashboard');
    };

    return (
        <Container>
            <Typography variant="h4" gutterBottom>Recommend Nominee Form</Typography>
            <form onSubmit={handleSubmit}>
                <FormControl fullWidth margin="normal">
                    <InputLabel>Select Nominee</InputLabel>
                    <Select
                        value={selectedNominee}
                        label="Select Nominee"
                        onChange={e => setSelectedNominee(e.target.value)}
                    >
                        {nominees.map((nominee) => (
                            <MenuItem key={nominee.id} value={nominee.id}>
                                {nominee.first_name} {nominee.last_name}
                            </MenuItem>
                        ))}
                    </Select>
                </FormControl>
                <FormGroup>
                    <FormControlLabel control={<Checkbox checked={workContributions.individual_contributor} onChange={handleWorkContributionChange} name="individual_contributor" />} label="Individual Contributor" />
                    <FormControlLabel control={<Checkbox checked={workContributions.project_manager} onChange={handleWorkContributionChange} name="project_manager" />} label="Project Manager" />
                    <FormControlLabel control={<Checkbox checked={workContributions.people_manager} onChange={handleWorkContributionChange} name="people_manager" />} label="People Manager" />
                </FormGroup>
                <TextField fullWidth margin="normal" label="Question for Individual Contributor" variant="outlined" name="ic_q1" value={answers.ic_q1} onChange={handleInputChange} />
                <TextField fullWidth margin="normal" label="Question for Project Manager" variant="outlined" name="pm_question" value={answers.pm_question} onChange={handleInputChange} />
                <TextField fullWidth margin="normal" label="Question for People Manager" variant="outlined" name="pep_question" value={answers.pep_question} onChange={handleInputChange} />
                <Button type="submit" variant="contained" color="success">Submit New Nominee</Button>
                <Button variant="contained" color="warning" onClick={handleBack} sx={{ ml: 2 }}>Back</Button>
            </form>
        </Container>
    );
}

export default RecommendNominee;
